!function(){
	$.ajaxSetup({
		cache : false
	});
	
	//2014_10_11 zhangyijun02: 因增加广告轮播曝光日志逻辑，调整showtrack初始化方式
	require.async(['topten_pc:widget/ui/usertrack/usertrack.js', 'topten_pc:widget/ui/lazyload/lazyload.js', 'topten_pc:widget/ui/cookie/cookie.js', 'topten_pc:widget/ui/showtrack/showtrack.js', 'topten_pc:widget/ui/items_post/items_post.js'], function(usertrack, LazyLoad, Cookie, ShowTrack, itemsPost){
		// 初始化点击监听
		usertrack.init();

		new LazyLoad({
			lazy : $('img[data-original]'),
			expect: 250
		});

		itemsPost.init();

		handleBaiduid();

		function handleBaiduid(){
			var getBaiduidUrl = "http://uid.nuomi.baidu.com/getbdid";
			var retryCount = 1;	
			getBaiduid();

			function getBaiduid(){

				$.ajax(getBaiduidUrl, {
					dataType : 'jsonp',
					success : function(json){
						if(json.errno == 0){
							var baiduid = json.data.baiduid;
							if(baiduid){
								Cookie.setRaw('BAIDUID', baiduid, 365);
							}
							// 不管有没有baiduid，都发送pv
							sendPv();
						}else{
							if(retryCount--){
								getBaiduid();
							}else{
								// 最后一次也获取失败
								sendPv();
							}							
						}					
						
					}
				});
			}
		

		}

		function sendPv(){
			usertrack.send({
				da_src : encodeURIComponent($.stringify({
					page : "zhuanti_t10"
				})),				
				element_type : "pv"
			});
		}

		//2014_10_11 zhangyijun02: 因增加广告轮播曝光日志逻辑，调整ShowTrack初始化方式
		//曝光日志统计
		ShowTrack.startShowTrack();			
	});

}();</script>
